import React from "react";


function add(a, b) {

    let result = 40 + 4;
    return result;

}
function sub(a, b) {
    let result = 40 - 4;
    return result;
}
function div(a, b) {
    let result = 40 / 4;
    return result;

}
function mul(a, b) {
    let result = 40 * 4;
    return result;

}

export default {add,sub,mul,div};
